const checkedWeather = (sky, pty) => {
  const requestDate = new Date();
  const currHour = requestDate.getHours();
  // 저녁
  if (currHour >= 18 || currHour <= 6) {
    // 맑을 때
    if (Number(sky) === 1) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.clear.night;
        default:
          return;
      }
    }
    // 구름 많음
    else if (Number(sky) === 3) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.cloudy.night.normal;
        case 1:
          return weatherIcons.cloudy.night.rain;
        case 3:
          return weatherIcons.cloudy.night.snow;
        default:
          return;
      }
    }
    // 흐림
    else if (Number(sky) === 4) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.rainy.night.normal;
        case 1:
          return weatherIcons.rainy.night.rain;
        case 2:
          return weatherIcons.rainy.night.snowAndRain;
        case 3:
          return weatherIcons.rainy.night.snow;
        default:
          return;
      }
    }
  }
  // 낮
  else {
    if (Number(sky) === 1) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.clear.day;
        default:
          return;
      }
    }
    // 구름 많음
    else if (Number(sky) === 3) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.cloudy.day.normal;
        case 1:
          return weatherIcons.cloudy.day.rain;
        case 3:
          return weatherIcons.cloudy.day.snow;
        default:
          return;
      }
    }
    // 흐림
    else if (Number(sky) === 4) {
      switch (Number(pty)) {
        case 0:
          return weatherIcons.rainy.day.normal;
        case 1:
          return weatherIcons.rainy.day.rain;
        case 2:
          return weatherIcons.rainy.day.snowAndRain;
        case 3:
          return weatherIcons.rainy.day.snow;
        default:
          return;
      }
    }
  }
};

export default checkedWeather;
